      title = "\uB77C\uC774\uBE0C \uC2DC\uC5B4\uD130 \uC5C5\uBB34\uD45C";
      table = [[11, "\uC624\uD504", ""], [12, "\uC2DC\uC5B4\uD130 \uB0B4 \uB4DC\uB77C\uB9C8\uB97C \uC218\uB85D. \uD14C\uB9C8\uB294 \uD30C\uD2B8\uB108 \uD50C\uB808\uC774\uC5B4\uC758 \u300C\uC88B\uC544\uD558\uB294 \uAC83\u300D\uC774\uB2E4.", "\uD30C\uD2B8\uB108 \uD50C\uB808\uC774\uC5B4\uAC00 \uBCF4\uC720\uD55C \uC18D\uC131\uBD84\uC57C\uC758\uD2B9\uAE30"], [13, "\uC2DC\uC5B4\uD130 \uB0B4 \uD310\uB9E4\uC6A9 CD\uB97C \uC81C\uC791. \uD14C\uB9C8\uB294 \uC52C \uD50C\uB808\uC774\uC5B4\uC758 \u300C\uC88B\uC544\uD558\uB294 \uAC83\u300D\uC774\uB2E4.\u3002", "\uC52C \uD50C\uB808\uC774\uC5B4\uAC00 \uBCF4\uC720\uD55C \uCDE8\uBBF8\uBD84\uC57C\uC758\uD2B9\uAE30"], [14, "\uC2DC\uC5B4\uD130\uC758 \uB9E4\uC810\uC5D0 \uB04C\uB824\uAC04\uB2E4. \uC9C1\uC811 \uC190\uB2D8\uACFC \uC811\uCD09\uD558\uB294 \uCC2C\uC2A4!", "\u300A\uBBF8\uC18C\uFF0F\uC7AC\uB2A57\u300B"], [15, "\uC2DC\uC5B4\uD130 \uB0B4\uC5D0\uC11C \uC0C1\uD488\uC744 \uD310\uB9E4. \uC9C0\uAE08\uC758 \uD310\uB9E4\uB418\uB294 \uC720\uD589\uC740 \uBB34\uC5C7\uC774\uC9C0?", "\u30AD\u30E3\u30E9\u5206\u91CE\u304B\u3089\u30E9\u30F3\u30C0\u30E0"], [16, "\uC2DC\uC5B4\uD130 \uB0B4\uC5D0\uC11C \uC545\uC218\uD68C\uB97C \uAC1C\uCD5C! \uC640\uC900 \uBAA8\uB450\uC5D0\uAC8C \uAC10\uC0AC\uB97C.", "\u300A\uBC30\uB824\uFF0F\uC7AC\uB2A59\u300B"], [22, "\uC624\uD504", ""], [23, "\uC774\uBC88 \uADF9\uC740 \uC52C \uD50C\uB808\uC774\uC5B4\uC758 \u3010\uBC30\uACBD\u3011\uC744 \uBC14\uD0D5\uC73C\uB85C \uD55C \uB17C\uD53D\uC158 \uB4DC\uB77C\uB9C8!", "\u8DA3\u5473\u5206\u91CE\u304B\u3089\u30E9\u30F3\u30C0\u30E0"], [24, "\uC2DC\uC5B4\uD130\uB97C \uC774\uC6A9\uD55C \uBC84\uB77C\uC774\uC5B4\uD2F0 \uAE30\uD68D\uC774 \uAC1C\uC2DC\uB418\uC5C8\uB2E4. \uBAA8\uB450\uB97C \uC6C3\uAE30\uC790.", "\u300A\uBC14\uBCF4\uFF0F\uCE90\uB9AD\uD13012\u300B"], [25, "\uC2DC\uC5B4\uD130\uC5D0 \uD750\uB974\uB294 \uBBF8\uB2C8 \uB77C\uB514\uC624\uB97C \uC218\uB85D. \uB9F4\uBC84\uC758 \uC5C9\uB6B1\uD568 \uB2E4\uB8E8\uB294 \uCF54\uB108\uAC00 \uBCFC\uAC70\uB9AC", "\u30AD\u30E3\u30E9\u5206\u91CE\u304B\u3089\u30E9\u30F3\u30C0\u30E0"], [26, "\uC2DC\uC5B4\uD130\uC5D0 \uD328\uC158 \uB514\uC790\uC774\uB108\uB97C \uBD88\uB7EC \uD328\uC158\uC1FC. \uC798 \uB9E4\uB8CC\uC2DC\uCF1C \uB098\uAC00\uC790.\u3002", "\u5C5E\u6027\u5206\u91CE\u304B\u3089\u30E9\u30F3\u30C0\u30E0"], [33, "\uC624\uD504", ""], [34, "\uC2DC\uC5B4\uD130 \uAE30\uD68D, 1D6\uC2DC\uAC04 \uC9D1\uC911 \uB304\uC2A4\uAC00 \uC2DC\uC791\uB41C\uB2E4\u2026\u2026.", "\u300A\uCCB4\uB825\uFF0F\uC7AC\uB2A56\u300B"], [35, "\uC2DC\uC5B4\uD130 \uAE30\uD68D, \uD30C\uD2B8\uB108 \uD50C\uB808\uC774\uC5B4\uB294 \u300C\uC2EB\uC740 \uAC83\u300D\uC5D0 \uBA87 \uBC88\uC774\uB098 \uB3C4\uC804\uD560 \uC218 \uC788\uC744\uAE4C!", "\uD30C\uD2B8\uB108 \uD50C\uB808\uC774\uC5B4\uAC00 \uBCF4\uC720\uD55C \uCDE8\uBBF8\uBD84\uC57C\uC758\uD2B9\uAE30"], [36, "\uC2DC\uC5B4\uD130 \uAE30\uD68D, \uC52C \uD50C\uB808\uC774\uC5B4 vs \u300C\uC2EB\uC740 \uAC83\u300D!", "\uC52C \uD50C\uB808\uC774\uC5B4\uAC00 \uBCF4\uC720\uD55C \uCE90\uB9AD\uD130\uBD84\uC57C\uC758\uD2B9\uAE30"], [44, "\uC624\uD504", ""], [45, "\uC2DC\uC5B4\uD130 \uAE30\uD68D, \uB9E4\uC6B0 \uB192\uC740 \uACE8\uC744 \uC704\uD574 \uD328\uC2A4! \u2026\u2026 \uC815\uB9D0\uB85C \uD560 \uC218 \uC788\uB294 \uAC70\uC57C?", "\u300A190\uFF5E\uFF0F\uC2E0\uC7A512\u300B"], [46, "\uC2DC\uC5B4\uD130 \uAE30\uD68D, \uB3D9\uBB3C\uC744 \uB300\uD558\uB294 \uC544\uC774\uB3CC\uC758 \uBAA8\uC2B5\uC744 \uC911\uACC4!", "\u300A\uD3AB\uFF0F\uCDE8\uBBF83\u300B"], [55, "\uC624\uD504", ""], [56, "\uADF9\uC7A5 \uBC16\uC5D0\uC11C \uC2E4\uC2DC\uD558\uB294 \uC77C\uC744 \uD574\uB0B8\uB2E4.", "\u30E9\u30F3\u30C0\u30E0"], [66, "\uC624\uD504", ""]];
